import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Sidebar from "./componentes/Sidebar";

function App() {
    return (
        <Router>
            <Sidebar />
            <Switch>
                <Route path="/usuarios/propietarios" component={() => <h1>Propietarios</h1>} />
                <Route path="/propiedades/departamentos" component={() => <h1>Departamentos</h1>} />
                <Route path="/propiedades/cocheras" component={() => <h1>Cocheras</h1>} />
                {/* Agrega las dem√°s rutas */}
            </Switch>
        </Router>
    );
}

export default App;
